import React from "react";
// node.js library that concatenates classes (strings)
import classnames from "classnames";
// javascipt plugin for creating charts
import Chart from "chart.js";
// react plugin used to create charts
import { Line, Bar } from "react-chartjs-2";
// reactstrap components
import {
  Button,
  Card,
  CardHeader,
  CardBody,
  NavItem,
  NavLink,
  Nav,
  Progress,
  Table,
  Container,
  Row,
  Col
} from "reactstrap";

// core components
import {
  chartOptions,
  parseOptions,
  chartExample1,
  chartExample2
} from "variables/charts.jsx";

import Header from "components/Headers/Header.jsx";
import Stock from "/Users/gregorymoncayo/Desktop/ToUpper LLC/WebSite/src/assets/img/brand/StockUp.jpg";

class Index extends React.Component {
  state = {
    activeNav: 1,
    chartExample1Data: "data1"
  };
  toggleNavs = (e, index) => {
    e.preventDefault();
    this.setState({
      activeNav: index,
      chartExample1Data:
        this.state.chartExample1Data === "data1" ? "data2" : "data1"
    });
    let wow = () => {
      console.log(this.state);
    };
    wow.bind(this);
    setTimeout(() => wow(), 1000);
    // this.chartReference.update();
  };
  componentWillMount() {
    if (window.Chart) {
      parseOptions(Chart, chartOptions());
    }
  }
  render() {
    const mystyle = {
      fontFamily: "Georgia",
      textAlign: 'left'
    };

    const imageStyle = {
      img: 'right',
    };

    return (
      <>
        <Header />

        <h1>hello</h1>
        <p style={mystyle}>Since 2019, we have been dedicated to providing users and customers the best experience.</p>
        <p style={mystyle}>At ToUpper LLC, we pride ourselves by providing the most modern look on both our applications and our webpages. <br></br>
        We prepare busineses to have their webpage looking sleek and professional for them to accompish their daily goals.
        </p>
        <img src={Stock} style="right" ></img>
      </>
    );
  }
}

export default Index;
